<?php
namespace OKohei\OpenAssets\Tests\Protocols;

use OKohei\OpenAssets\Protocols\MarkerOutput;
use BitWasp\Bitcoin\Bitcoin;
use BitWasp\Buffertools\Buffer;
use BitWasp\Bitcoin\Network\NetworkFactory;

class MarkerOutputTest extends \PHPUnit_Framework_TestCase
{
   public function __construct()
   {
       $testnet = NetworkFactory::bitcoinTestnet();
       Bitcoin::setNetwork($testnet);
   }

   public function testSerializePayload()
   {
       $markerOutput = new MarkerOutput([10000], 'u=https://cpr.sm/5YgSU1Pg-q');
       $payload = $markerOutput->serializePayload();
       $this->assertEquals($payload, '4f41010001904e1b753d68747470733a2f2f6370722e736d2f35596753553150672d71');

       $markerOutput = new MarkerOutput([10000], null);
       $payload = $markerOutput->serializePayload();
       $this->assertEquals($payload, '4f41010001904e00');

       $assetQuantities = [];
       for($i = 0; $i < 252; $i++) {
           array_push($assetQuantities, 4);
       }
       $markerOutput = new MarkerOutput($assetQuantities, null);
       $payload = $markerOutput->serializePayload();
       $this->assertEquals($payload, '');
       
       
       $assetQuantities = [];
       for($i = 0; $i < 253; $i++) {
           array_push($assetQuantities, 4);
       }
       $markerOutput = new MarkerOutput($assetQuantities, null);
       $payload = $markerOutput->serializePayload();
       $this->assertEquals($payload, '');
   
   	$assetQuantities = [];
       for($i = 0; $i < 10000; $i++) {
           array_push($assetQuantities, 4);
       }
       $markerOutput = new MarkerOutput($assetQuantities, null);
       $payload = $markerOutput->serializePayload();
       $this->assertEquals($payload, '');
       
       $assetQuantities = [];
       for($i = 0; $i < 65535; $i++) {
           array_push($assetQuantities, 4);
       }
   	$markerOutput = new MarkerOutput($assetQuantities, null);
       $payload = $markerOutput->serializePayload();
       $this->assertEquals($payload, '');
       
       $assetQuantities = [];
       for($i = 0; $i < 65536; $i++) {
           array_push($assetQuantities, 4);
       }
   	$markerOutput = new MarkerOutput($assetQuantities, null);
       $payload = $markerOutput->serializePayload();
       $this->assertEquals($payload, '');
       
   
   }
   
   public function testDeserializePayload()
   {
       $markerOutput = MarkerOutput::deserializePayload('4f41010001904e1b753d68747470733a2f2f6370722e736d2f35596753553150672d71');
       $metadata = $markerOutput->getMetadata();
       $assetQuantity = $markerOutput->getAssetQuantities();
       $this->assertEquals(1, count($assetQuantity));
       $this->assertEquals([10000], $assetQuantity);
       $this->assertEquals( 'u=https://cpr.sm/5YgSU1Pg-q', $metadata);
       $markerOutput = MarkerOutput::deserializePayload('4f41010002904ee7071b753d68747470733a2f2f6370722e736d2f35596753553150672d71');
       $metadata = $markerOutput->getMetadata();
       $assetQuantity = $markerOutput->getAssetQuantities();
       $this->assertEquals(2, count($assetQuantity));
       $this->assertEquals([10000, 999], $assetQuantity);
       $this->assertEquals('u=https://cpr.sm/5YgSU1Pg-q', $metadata);
   }

   public function testBothSerializeAndDeserialize()
   {
       $assetQuantities = [];
       $rand = mt_rand(0, 60000);
       for($i = 0; $i < $rand; $i++) {
           array_push($assetQuantities, $rand);
       }
       $markerOutput = new MarkerOutput($assetQuantities, null);
       $payload = $markerOutput->serializePayload();
       $markerOutput = MarkerOutput::deserializePayload($payload);
       $this->assertEquals($rand, count($markerOutput->getAssetQuantities()));
       $this->assertEquals($rand, $markerOutput->getAssetQuantities()[0]);
   }

   public function testParseScript()
   {
       $buffer = Buffer::hex('6a084f41010002014400');
       $parsedScript = MarkerOutput::parseScript($buffer);
       $this->assertEquals('4f41010002014400', $parsedScript);
   }
   
   public function testParseScriptNotStartWithOAP()
   {
       $buffer = Buffer::hex('6a04deadbeef');
       $parsedScript = MarkerOutput::parseScript($buffer);
       $this->assertNull($parsedScript);
   }
    
