    }

    public function testBuildScript()
    {
        $markerOutput = new MarkerOutput([10000], 'u=https://cpr.sm/5YgSU1Pg-q');
        $script = $markerOutput->buildScript();
        $this->assertEquals($script->getScriptParser()->getHumanReadable(), 'OP_RETURN 4f41010001904e1b753d68747470733a2f2f6370722e736d2f35596753553150672d71');
    }
}
